import { Autocomplete } from '@mui/material';
import { maxWidth } from '@mui/system';
import { DataGrid, MAX_PAGE_SIZE } from '@mui/x-data-grid';
export const Transactions=()=>{

    const columns = [
        { field: 'id', headerName: 'Transaction ID', width: MAX_PAGE_SIZE },
        { field: 'amount', headerName: 'Transaction amount', width: 130 },
        { field: 'dot', headerName: 'Date of the Transaction', width: 130 },
        {
          field: 'type',
          headerName: 'Transaction Type',
          width: 90,
        },
        {
            field: 'account',
            headerName: 'Involved Account',
            width: 90,
        },  
      ];

    return(<>
        <div className="row justify-content-center">
            <div style={{ height: 400, width: '100%' }}>
                <DataGrid
                    columns={columns}
                    pageSize={7}
                    rowsPerPageOptions={[7]}
                />
            </div>
        </div>
    </>)
}
